    "2015-05-06T21:56:36.241692",nt"name": "high-energy-low-temperature-gelled-bi-propellant-formulation-for-long-duration-in-space-pr-3b339",nt"isopen":
    true,nt"url": null,nt"notes": "The use of gelled propellants for deep space
    planetary missions may enable adoption of high performance (Isp-vac&gt;360 sec)
    propellant combinations that do not require power-intensive heating and stirring
    cycles before firings, and whose handling and safety characteristics are close to
    stated goals of "green" propellants.rnrnPhase I focused on the ability to gel
    both halves of the propellant combination of liquid propane and MON-30 (GLP/GMON-30).
     This combination was selected to provide extended low-temperature capability.
     Both components were successfully gelled and preliminary rheological data was
    taken.  To allow system-wide studies of the impact of gelled propellant adoption,
    non-Newtonian gel rheology models were added to NASA's flow network system analysis
    code, Generalized Fluid System Simulation Program (GFSSP).  These models were validated
    with experimental gel data.  Preliminary two-fluid CFD simulations were performed
    to understand the flow of gelled propellants in microgravity environments.  rnrnPhase
    II will culminate in a hot-fire demonstration of a GLP/GMON-30 rocket chamber, to
    be performed at AMRDEC facilities.  To support this, hardware for gelling of the
    propellants will be fabricated and delivered to NASA.  Suitable quantities of the
    gelled propellants will be prepared and fundamental data, including rheological
    and freezing point behavior will be determined.  Expanded system-level assessments
    will be performed, using both GFSSP and CFD tools.rnrn",nt"license_title":
